-- creates missing relations between products<->sub_products due to some unknown migration/orm bug

CREATE TABLE lmartinho_TreeNodeTreeNodeRelation AS SELECT parent_tree_node_object_id, child_tree_node_object_id FROM TreeNodeTreeNodeRelation WHERE 0=1;

BEGIN TRANSACTION;
COMMIT;

BEGIN TRANSACTION;
SELECT parent_tree_node_object_id, child_tree_node_object_id
  FROM lmartinho_TreeNodeTreeNodeRelation
 WHERE child_tree_node_object_id IN (
    -- get all the subproducts without a parent
    SELECT object_id
      FROM SubProduct
    EXCEPT
    SELECT child_tree_node_object_id
      FROM TreeNodeTreeNodeRelation);
COMMIT;

DROP TABLE lmartinho_TreeNodeTreeNodeRelation;
